pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract VotingSystem {
    
    struct election {
        uint ElectionId;
        string Title;
        uint64 DateFrom;
        uint64 DateTo;
        uint8 KeysPerVoter;
        string[] Candidates;
    }

    struct electionDetails {
        uint ElectionId;
        string Title;
        uint64 DateFrom;
        uint64 DateTo;
        uint8 KeysPerVoter;
        result[] Results;
    }

    struct key {
        address KeyValue;
